-- Migration 003 Part 1: Geo Schema + States + Counties + Cities
-- Source: US Census via github.com/scpike/us-state-county-zip
BEGIN;

CREATE TABLE IF NOT EXISTS states (
  code VARCHAR(2) PRIMARY KEY,
  name VARCHAR(100) NOT NULL,
  fips VARCHAR(2),
  is_active BOOLEAN DEFAULT true,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE IF NOT EXISTS counties (
  id SERIAL PRIMARY KEY,
  state_code VARCHAR(2) NOT NULL REFERENCES states(code),
  name VARCHAR(255) NOT NULL,
  slug VARCHAR(255) NOT NULL,
  fips VARCHAR(5),
  is_active BOOLEAN DEFAULT true,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  UNIQUE(state_code, slug)
);

CREATE TABLE IF NOT EXISTS cities (
  id SERIAL PRIMARY KEY,
  state_code VARCHAR(2) NOT NULL REFERENCES states(code),
  name VARCHAR(255) NOT NULL,
  slug VARCHAR(255) NOT NULL,
  county_name VARCHAR(255),
  lat DECIMAL(10,6),
  lng DECIMAL(10,6),
  population INTEGER,
  is_active BOOLEAN DEFAULT true,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  UNIQUE(state_code, slug)
);

CREATE TABLE IF NOT EXISTS zip_codes (
  zip VARCHAR(5) PRIMARY KEY,
  city_id INTEGER REFERENCES cities(id),
  state_code VARCHAR(2) NOT NULL REFERENCES states(code),
  city_slug VARCHAR(255),
  county_name VARCHAR(255),
  is_active BOOLEAN DEFAULT true,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

CREATE INDEX IF NOT EXISTS idx_counties_state ON counties(state_code);
CREATE INDEX IF NOT EXISTS idx_cities_state ON cities(state_code);
CREATE INDEX IF NOT EXISTS idx_cities_slug ON cities(slug);
CREATE INDEX IF NOT EXISTS idx_zip_codes_city ON zip_codes(city_id);
CREATE INDEX IF NOT EXISTS idx_zip_codes_state ON zip_codes(state_code);

-- === TARGETING TABLES (PRD Section 7.3) ===
CREATE TABLE IF NOT EXISTS site_target_states (
  id SERIAL PRIMARY KEY,
  site_id UUID NOT NULL REFERENCES sites(id) ON DELETE CASCADE,
  state_code VARCHAR(2) NOT NULL REFERENCES states(code),
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  UNIQUE(site_id, state_code)
);

CREATE TABLE IF NOT EXISTS site_target_counties (
  id SERIAL PRIMARY KEY,
  site_id UUID NOT NULL REFERENCES sites(id) ON DELETE CASCADE,
  county_id INTEGER NOT NULL REFERENCES counties(id),
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  UNIQUE(site_id, county_id)
);

CREATE TABLE IF NOT EXISTS site_target_zips (
  id SERIAL PRIMARY KEY,
  site_id UUID NOT NULL REFERENCES sites(id) ON DELETE CASCADE,
  zip VARCHAR(5) NOT NULL REFERENCES zip_codes(zip),
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  UNIQUE(site_id, zip)
);

CREATE TABLE IF NOT EXISTS site_target_cities (
  id SERIAL PRIMARY KEY,
  site_id UUID NOT NULL REFERENCES sites(id) ON DELETE CASCADE,
  city_id INTEGER NOT NULL REFERENCES cities(id),
  source VARCHAR(20) NOT NULL DEFAULT 'zip',
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  UNIQUE(site_id, city_id)
);

CREATE INDEX IF NOT EXISTS idx_site_target_states_site ON site_target_states(site_id);
CREATE INDEX IF NOT EXISTS idx_site_target_counties_site ON site_target_counties(site_id);
CREATE INDEX IF NOT EXISTS idx_site_target_zips_site ON site_target_zips(site_id);
CREATE INDEX IF NOT EXISTS idx_site_target_cities_site ON site_target_cities(site_id);

-- === SITES: add slug_strategy_config if missing ===
ALTER TABLE sites ADD COLUMN IF NOT EXISTS slug_strategy_config JSONB DEFAULT '{}';




COMMIT;